import React from 'react';
import styled from 'styled-components';

const Img = styled.img`
  width: 100%;
  height: 100%;
  object-fit: cover;
`;

export const UnsplashImage = ({ url, key }) => {
    return (
        <>
            <Img key={key} src={url} alt="" />
        </>
    )
}
